import React from 'react'
import { Link } from 'react-router-dom'

export default function NavBar() {




  return (
    <div>
        <Link to='/home'>
            <h3>Home</h3>
        </Link>
        <Link to='/activities'>
            <h3>Add a activity</h3>
        </Link>




    </div>
  )
};
